$(function(){if($(".pie")){$(".pie").each(function(e,t){var n=$(this).attr("title");n=n.replace(/%/g,"");arrPcent=n.split(" ");var r=0;for(var e=0;e<arrPcent.length;e++){r+=Number(arrPcent[e])}if(r>100){var i="ERROR: percents totalling more than 100%";console.log(i);return i}var s=$(this).height();var o=s/2;var u=0;var a="";for(var e=0;e<arrPcent.length;e++){pcent=arrPcent[e];if(pcent>50){s=s+"px";o=o+"px";var f=pcent-50;var l=360*(f/100);a=a+"<div style='clip: rect(0px "+s+" "+s+" 0px); -webkit-transform: rotate("+u+"deg); -ms-transform: rotate("+u+"deg); transform: rotate("+u+"deg);'><div class='fill' style='clip: rect(0px "+o+" "+s+" 0px); -webkit-transform: rotate(180deg); -ms-transform: rotate(180deg); transform: rotate(180deg);'></div></div><div style='clip: rect(0px "+s+" "+s+" "+o+"); -webkit-transform: rotate(180deg); -ms-transform: rotate(180deg); transform: rotate(180deg);'><div class='fill"+(e+1)+"' style='clip: rect(0px "+o+" "+s+" 0px); -webkit-transform: rotate("+l+"deg); -ms-transform: rotate("+l+"deg); transform: rotate("+l+"deg);'></div></div>"}else{var l=360*(pcent/100);a=a+"<div style='clip: rect(0px "+s+" "+s+" "+o+"); -webkit-transform: rotate("+u+"deg); -ms-transform: rotate("+u+"deg); transform: rotate("+u+"deg);'><div class='fill"+(e+1)+"' style='clip: rect(0px "+o+" "+s+" 0px); -webkit-transform: rotate("+l+"deg); -ms-transform: rotate("+l+"deg); transform: rotate("+l+"deg);'></div></div>"}u+=l}$(this).html(a)})}})